import { forwardRef } from 'react'
import images from '~/assets/images'

const Image = forwardRef(({ src, ...props}, ref) => {
  // eslint-disable-next-line jsx-a11y/alt-text
  return <img ref={ref} {...props} />
})

export default Image;
